import React, { useState } from "react";
import axios from "axios";

function AddEmployee() {
  const [employeeId, setEmployeeId] = useState("");
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("");

  function handleSubmit(e) {
    e.preventDefault();

    const newEmployee = {
      employeeId,
      firstName,
      lastName,
      username,
      email,
      password,
      role,
    };

  
    axios.post("http://localhost:8090/employee/create", newEmployee);
      alert("Employee added successfully!");
    
  };

  return (
    <div className="container mt-5">
      <h2 className="text-center">Add Employee</h2>
      <form onSubmit={handleSubmit} className="p-4 shadow rounded bg-light">
        <div className="mb-3">
          <label className="form-label">Employee ID</label>
          <input type="text" className="form-control" required onChange={(e) => setEmployeeId(e.target.value)} />
        </div>
        <div className="mb-3">
          <label className="form-label">First Name</label>
          <input type="text" className="form-control" required onChange={(e) => setFirstName(e.target.value)} />
        </div>
        <div className="mb-3">
          <label className="form-label">Last Name</label>
          <input type="text" className="form-control" required onChange={(e) => setLastName(e.target.value)} />
        </div>
        <div className="mb-3">
          <label className="form-label">Username</label>
          <input type="text" className="form-control" required onChange={(e) => setUsername(e.target.value)} />
        </div>
        <div className="mb-3">
          <label className="form-label">Email</label>
          <input type="email" className="form-control" required onChange={(e) => setEmail(e.target.value)} />
        </div>
        <div className="mb-3">
          <label className="form-label">Password</label>
          <input type="password" className="form-control" required onChange={(e) => setPassword(e.target.value)} />
        </div>
        <div className="mb-3">
          <label className="form-label">Role</label>
         

          <input type="text" className="form-control" required onChange={(e) => setRole(e.target.value)} />
        </div>
        <button type="submit" className="btn btn-primary w-100">Add Employee</button>
      </form>
    </div>
  );
}

export default AddEmployee;
